import React, { Component } from 'react'

export default class Child1 extends Component {
  render() {
    //  let pr= this.props.inncomingProduct
    // console.log(pr.price);
     let {id, name, category, price, stock, sale} = this.props.inncomingProduct
     let onSale = sale? `<span className='bg-danger h6 p-2 text-white'>{onSale}</span>`:``;
    return (
      <div className='col-4 g-3'>
        <div className='bg-light text-start p-3'>
          <h4 className=''>{name}</h4>
          <h4 className=''>{category}</h4>
          <h4 className=''>{price} {onSale}</h4>
          <h4 className=''>{stock}</h4>
        </div>
      </div>
    )
  }
}
